import React, { useEffect, useState } from "react";
import TopSongsHeader from "./TopSongsHeader";
import eth from "../../../src/assets/Icons/eth.png";
import { Sparklines, SparklinesLine } from "react-sparklines";

import "rsuite/dist/rsuite.min.css";

import DropdownsandSearchHeader from "./DropdownsandSearchHeader";

import { Card, Col, Table, Button } from "react-bootstrap";

export default function Songs() {
  const [onSongs, setonSongs] = useState(true);

  const [selectedSong, setSelectedSong] = useState({});
  const sampleData = [8, 3, 8, 6, 5, 3, 5, 7, 5];
  //straight line graph
  const sampleData2 = [8, 8, 8, 8, 8, 8, 8, 8, 8];

  //positive graph
  const sampleData3 = [8, 3, 5, 2, 7, 6, 10, 7, 16];

  const coinData = [
    {
      value: 1,
      symbol: "ETH",
      name: "Ethereum",
      icon: eth,
      price: 100,
      change: 10,
      volume: 1000,
      tvl: 10000,
      graph: sampleData,
      //set light red color
      strokeColor: "#FF0000",
    },
    {
      value: 2,
      symbol: "BTC",
      name: "Bitcoin",
      icon: eth,
      price: 100,
      change: 10,
      volume: 1000,
      tvl: 10000,
      graph: sampleData2,
      //set light green color
      strokeColor: "#808080",
    },
    {
      value: 3,
      symbol: "MATIC",
      name: "Matic",
      icon: eth,
      price: 100,
      change: 10,
      volume: 1000,
      tvl: 10000,
      graph: sampleData3,
      // set grey color
      strokeColor: "#00FF00",
    },
  ];

  const data = [
    {
      value: 1,
      text: "MUD",
      icon: (
        <svg
          xmlns="http://www.w3.org/2000/svg"
          width="16"
          height="16"
          fill="currentColor"
          class="bi bi-arrow-up-circle"
          viewBox="0 0 16 16">
